import React from 'react';

import styles from './Flight.module.scss';

export default function Flight({ flight }) {
  console.log(flight?.links?.youtube_id);
  return (
    <div>
      <iframe
        className={styles.video}
        src={`//www.youtube.com/embed/${flight?.links?.youtube_id}?cautoplay=1&loop=1`}
      ></iframe>
    </div>
  );
}
